import ReactImage from 'react-image-wrapper'
import finance from './assets/financeicon.png'



const TechTitle = () => {
    return ( 
        <div className="tech-title">
            <h3>Technology</h3>
            <div className="tech-image">
              <ReactImage 
                src={finance}
                width={30}
                height={30}
                title="Technology"
           />
            </div>
        </div>
     );
}
 
export default TechTitle;
